"""The api client for ElprisetJustNu."""
import asyncio
from dataclasses import dataclass
from datetime import date, datetime, timedelta
import json
import logging
from typing import Optional

import aiohttp

from .const import API_URL

_LOGGER = logging.getLogger(__name__)


class LoginRequired(Exception):
    """Login exception."""

    def __str__(self):
        """Return error message."""
        return "Please login first."


class ElprisetJustNuClient:
    """Api client."""

    @dataclass
    class PriceInfo:
        """PriceInfo class."""

        @dataclass
        class Price:
            """Price class."""

            hour: int
            price: float

        dte: date  # = date.today()
        prices: list[Price]
        day_average: float
        offset: int  # = 0

    def __init__(self, session) -> None:
        """Initialize client."""
        self.url = API_URL
        self.session = session
        self.timeout = 10

    async def fetchData(self, startDate: date, price_zone: str) -> list[PriceInfo]:
        """Fetch data function."""
        startOffset: int = 1
        dte: date = startDate + timedelta(days=startOffset)

        pis: list[ElprisetJustNuClient.PriceInfo] = []

        for i in range(6):
            fdte = dte + timedelta(days=-i)
            # print("fetching: ", fdte)
            ret = await self.getData(fdte, price_zone)
            if ret is not None and len(ret) > 0:
                pi = ElprisetJustNuClient.PriceInfo(
                    fdte,
                    ret,
                    sum(p.price for p in ret) / len(ret),
                    startOffset - i,
                )

                pis.append(pi)
                if pi.offset == 0 or len(pis) > 1:
                    break

        return pis

    def getPricesFromJsonString(self, sJson: str) -> Optional[list[PriceInfo.Price]]:
        """Fetch info from json."""
        ret: list[ElprisetJustNuClient.PriceInfo.Price] = []
        if len(sJson) > 0:
            json_object = json.loads(sJson)
            for o in json_object:
                try:
                    p = ElprisetJustNuClient.PriceInfo.Price(
                        datetime.fromisoformat(o["time_start"]).hour, o["SEK_per_kWh"]
                    )
                    ret.append(p)
                except ValueError as valErr:
                    _LOGGER.error("Error %s", valErr)
        return ret

